import React, { useState } from "react";
import "./Search.css";

export default function Search({ onSearch }) {
  const [searchCriteria, setSearchCriteria] = useState({
    make: "",
    model: "",
    year: "",
    state: "",
    car_condition: "",
    sales_category: "",
    body_type: "",
    fuel_type: "",
    engine: "",
    transmission: "",
    odometer: "",
    sale_date: "",
    custom_date: "",
    badges: "",
    cylinders: "",
    division: "",
    drive: "",
    seats: "",
    doors: ""
  });

  const [showMoreFilters, setShowMoreFilters] = useState(false);

  const options = {
    make: ["Audi", "BMW", "Mercedes", "Toyota"],
    model: ["A5", "A6", "X5", "C-Class", "Camry"],
    year: ["2015", "2016", "2017", "2018"],
    state: ["Victoria", "New South Wales", "Western Australia", "Tasmania", "Queensland"],
    car_condition: ["New", "Used", "Certified Pre-Owned"],
    sales_category: ["Private", "Dealer"],
    body_type: ["Sedan", "Sportback", "SUV", "Truck"],
    fuel_type: ["Gasoline", "Diesel", "Electric", "Hybrid"],
    engine: ["2.0 Turbo", "3.0 V6", "4.0 V8"],
    transmission: ["Automatic", "Manual"],
    odometer: ["0-50000", "50000-100000", "100000-150000"],
    sale_date: ["Last Week", "Last Month", "Last Year"],
    custom_date: ["2024-02-07", "2024-01-01", "2023-12-01"],
    badges: ["Quattro", "M Performance", "AMG"],
    cylinders: ["4", "6", "8"],
    division: ["Luxury", "Sports", "Economy"],
    drive: ["FWD", "RWD", "AWD"],
    seats: ["2", "4", "5", "7"],
    doors: ["2", "4", "5"]
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setSearchCriteria({
      ...searchCriteria,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const filteredCriteria = Object.fromEntries(
      Object.entries(searchCriteria).filter(([_, value]) => value !== "")
    );

    // 处理 odometer 过滤逻辑
    if (filteredCriteria.odometer) {
      const [min, max] = filteredCriteria.odometer.split("-").map(val => parseInt(val));
      filteredCriteria.odometer_min = min;
      filteredCriteria.odometer_max = max;
      delete filteredCriteria.odometer;
    }

    onSearch(filteredCriteria);
  };

  const handleReset = () => {
    setSearchCriteria({
      make: "", model: "", year: "", state: "", car_condition: "", sales_category: "",
      body_type: "", fuel_type: "", engine: "", transmission: "", odometer: "",
      sale_date: "", custom_date: "", badges: "", cylinders: "", division: "",
      drive: "", seats: "", doors: ""
    });
    onSearch({});
  };

  return (
    <div className="search-container">
      <h2>Car Search</h2>
      <form onSubmit={handleSubmit}>
        <div className="search-fields">
          {Object.keys(searchCriteria).slice(0, showMoreFilters ? 20 : 8).map((key) => (
            <div key={key} className="search-field">
              <label>{key.replace(/_/g, " ")}</label>
              <select name={key} value={searchCriteria[key]} onChange={handleInputChange}>
                <option value="">Select {key}</option>
                {options[key] && options[key].map((option) => (
                  <option key={option} value={option}>{option}</option>
                ))}
              </select>
            </div>
          ))}
        </div>
        <div className="button-group">
          <button type="button" onClick={() => setShowMoreFilters(!showMoreFilters)}>
            {showMoreFilters ? "Show Less Filters" : "More Filters"}
          </button>
          <button type="button" onClick={handleReset}>Reset Filters</button>
          <button type="submit">Search</button>
        </div>
      </form>
    </div>
  );
}
